const Hello = () => {
  return (
    <p>Hello World</p>
  )
}
const App = () => {
  console.log('Hello from App');
  const now = new Date();

  return (<div>
    <Hello />
    <p>it is now {now.toString()}</p>
  </div>
  )
}


export default App;
